"""
107. Word Break
中文
English

Given a string s and a dictionary of words dict, determine if s can be break into a space-separated sequence of one or more dictionary words.
Example

Example 1:
	Input:  "lintcode", ["lint", "code"]
	Output:  true

Example 2:
	Input: "a", ["a"]
	Output:  true
"""

class Solution:
    """
    @param: s: A string
    @param: dict: A dictionary of words dict
    @return: A boolean
    """
    def wordBreak(self, s, d):
        self.count = 0
        return self.helper(s, d, {})

    def helper(self, s, d, cache):
        if not s:
            return True
        if s in cache:
            self.count += 1
            if not self.count % 1000:
                print(self.count)
            return cache[s]
        for word in d:
            new_s = s.replace(word, '')
            if new_s != s:
                cache[new_s] = self.helper(new_s, d, cache)
                if cache[new_s]:
                    return True
        return False

if __name__ == "__main__":
    s = Solution()
    print(s.wordBreak(""
, ["ab","bc","cd","de","ef"]))
    assert(not s.wordBreak('aaab', set(['b', 'aa'])))
    assert(s.wordBreak("lintcode", set(['lint', 'code'])))
    assert(s.wordBreak("a", set(['a'])))
